import React from "react";
import {
  UilTemperature,
  UilTear,
  UilWind,
  UilSun,
  UilSunset,
} from "@iconscout/react-unicons";

const TemperatureAndDetails = () => {
    return (
        <div className="bg-orange-300"> 
          <div className="flex flex-row tex py-3">
            <div className="flex flex-col space-y-2">
              <div className="flex font-light text-sm items-center justify-center">
                <UilTemperature size={18} className="mr-1 text-red-500" />
                Real feel:
              </div>
              <div className="flex font-light text-sm items-center justify-center">
                <UilTear size={18} className="mr-1 text-red-500" />
                Humidity:
                <span className="font-medium ml-1"></span>
              </div>
              <div className="flex font-light text-sm items-center justify-center">
                <UilWind size={18} className="mr-1 text-red-500" />
                Wind:
                <span className="font-medium ml-1"></span>
              </div>
            </div>
          </div>
        </div>
    );
}

export default TemperatureAndDetails;
